IF OBJECT_ID('dbo.proc_transform_495', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_495;
GO
CREATE PROCEDURE dbo.proc_transform_495
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_495
    SET payload = LEFT(payload, 1000) + N'|V4-495|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_495;
END
GO
IF OBJECT_ID('dbo.audit_v4_495', 'U') IS NULL
BEGIN
    CREATE TABLE dbo.audit_v4_495 (aid INT IDENTITY(1,1) PRIMARY KEY, msg NVARCHAR(2000), created_on DATETIME2 DEFAULT SYSUTCDATETIME());
END
GO
EXEC dbo.proc_transform_495;
GO

CREATE INDEX IDX_staging_495_payload ON dbo.staging_table_495 (id);
